def calc_BMI(height, weight):
	h = height / 100
	return weight / (h * h)

#Detects landmarks
def get_landmarks(im):
    try:
        rects = cascade.detectMultiScale(im, 1.1, 3)
        x = int(rects[0][0])
        y = int(rects[0][1])
        w = int(rects[0][2])
        h = int(rects[0][3])
        rect = dlib.rectangle(x, y, x+w, y+h)
        shape = predictor(im, rect)
        landmarks = numpy.array([[p.x, p.y] for p in shape.parts()])
    except Exception as ex:
        landmarks = "bad features"
    return landmarks


#Finds weight in a given line
def getWeight(name):
    i = re.search("W-[0-9]{1,3}", name)
    weight = i.group(0)[2:]
    return weight

#Finds height in a given line
def getHeight(name):
    i = re.search("H-[0-9]{1,3}", name)
    height = i.group(0)[2:]
    return height
    

def train_bmi_predictor(image_list, feature_list):
    try:
        bmi = []
        for image in image_list:
            true_weight = int(getWeight(image))
            true_height = int(getHeight(image))
            true_bmi = calc_BMI(true_height, true_weight)
            bmi.append(true_bmi)
        try:
            landmarks = numpy.array(feature_list)
            return grid.fit(landmarks, bmi)
            #return bmi_classifier.fit(landmarks, bmi)
        except Exception as ex:
            print(ex)
            pass
    except ValueError:
        pass

